export const quizData = {
  totalQuestions: 10,
  perQuestionScore: 1,
  questions: [
    {
      question:
        "Which function is used to serialize an object into a JSON string in Javascript?",
      choices: ["stringify()", "parse()", "convert()", "None of the above"],
      correctAnswer: "stringify()"
    },
    {
      question:
        "Which of the following keywords is used to define a variable in Javascript?",
      choices: ["var", "let", "var and let", "None of the above"],
      correctAnswer: "var and let"
    },
    {
      question:
        "Which of the following methods can be used to display data in some form using Javascript?",
      choices: [
        "document.write()",
        "console.log()",
        "window.alert",
        "All of the above"
      ],
      correctAnswer: "All of the above"
    },
    {
      question: "How can a datatype be declared to be a constant type?",
      choices: ["const", "var", "let", "constant"],
      correctAnswer: "const"
    },
    {
      question: "In COBOL, which keyword is used to define a variable?",
      choices: ["DATA", "VAR", "PIC", "VALUE"],
      correctAnswer: "PIC"
    },
    {
      question: "Which of the following is the first step in a FORTRAN program?",
      choices: ["DECLARE", "PROGRAM", "INTEGER", "READ"],
      correctAnswer: "PROGRAM"
    },
    {
      question: "Which operator is used for string concatenation in JavaScript?",
      choices: ["+", "-", "*", "&"],
      correctAnswer: "+"
    },
    {
      question: "In BASIC, which command is used to end the program?",
      choices: ["EXIT", "END", "STOP", "QUIT"],
      correctAnswer: "END"
    },
    {
      question:
        "In FORTRAN, which statement is used to display output on the screen?",
      choices: ["PRINT", "DISPLAY", "OUTPUT", "SHOW"],
      correctAnswer: "PRINT"
    },
    {
      question:
        "Which of the following is used to define a function in JavaScript?",
      choices: ["def", "function", "method", "lambda"],
      correctAnswer: "function"
    }
  ]
};
